import React from 'react';
// Remove the CSS import for now

function App() {
  return (
    <div style={{
      minHeight: '100vh',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: '#f0f9ff',
      fontFamily: 'Arial, sans-serif'
    }}>
      <div style={{ textAlign: 'center' }}>
        <h1 style={{ 
          color: '#16a34a', 
          fontSize: '3rem', 
          marginBottom: '1rem' 
        }}>
          Smart Farm Connect
        </h1>
        <p style={{ 
          fontSize: '1.2rem', 
          color: '#374151',
          marginBottom: '2rem'
        }}>
          Agricultural Platform for South Sudan
        </p>
        <button style={{
          backgroundColor: '#16a34a',
          color: 'white',
          padding: '12px 24px',
          border: 'none',
          borderRadius: '8px',
          fontSize: '1rem',
          cursor: 'pointer',
          margin: '0 8px'
        }}>
          Get Started
        </button>
        <button style={{
          backgroundColor: 'transparent',
          color: '#16a34a',
          padding: '12px 24px',
          border: '2px solid #16a34a',
          borderRadius: '8px',
          fontSize: '1rem',
          cursor: 'pointer',
          margin: '0 8px'
        }}>
          Learn More
        </button>
      </div>
    </div>
  );
}

export default App;
